pragma solidity ^0.8.7;

import "./test2.sol";
//0xB9e2A2008d3A58adD8CC1cE9c15BF6D4bB9C6d72

contract contracts_bad {
    uint16[4] values;

    constructor () {
        for(uint16 i;i < 4;i++) {
            values[i] = i;
        }
    }

    function testCanon(uint16[] memory aux) public returns (bool) {
        for (uint256 i; i<aux.length; i++) {
            values[i] = aux[i];
        }
        return true;
    }

}

